g2:c.PROCEDURE.g2:a.TEXT:
_protools-snap-to-subject-item(Subject: class item)
X: class protools-authored-item;
IsPerm: truth-value;
WS: class kb-workspace;
begin
    if Subject does not exist or the workspace WS of Subject does not exist then return;
    for X = each protools-authored-item that is protools-authored-item-with-subject Subject do
        IsPerm = the permanent of X; 
        make X transient;
        transfer X to WS at (the item-x-position of Subject + the _protools-x-offset of X, the item-y-position of Subject + the _protools-y-offset of X);
        if IsPerm then make X permanent;
    end;
end
